import React, { useState, useEffect } from "react";
import alexGrey1 from "../assets/alex-grey-1.jpg";
import alexGrey2 from "../assets/alex-grey-2.jpg";

import cat1 from "../assets/cats/cat-1.jpg";
import cat2 from "../assets/cats/cat-2.jpg";
import cat3 from "../assets/cats/cat-3.jpg";
import cat4 from "../assets/cats/cat-4.jpg";
import cat5 from "../assets/cats/cat-5.jpg";
import cat6 from "../assets/cats/cat-6.jpg";
// import cat7 from "../assets/cats/cat-7.jpg";
// import cat8 from "../assets/cats/cat-8.jpg";
// import cat9 from "../assets/cats/cat-9.jpg";
// import cat10 from "../assets/cats/cat-10.jpg";
// import cat11 from "../assets/cats/cat-11.jpg";
// import cat12 from "../assets/cats/cat-12.jpg";

const Personal = () => {
  const [state, setState] = useState("");

  const [cats, setCats] = useState([
    {
      id: "1",
      name: "cat1",
      imgSrc: cat1,
      description: "Sleeping Sylvia"
    },
    {
      id: "2",
      name: "cat2",
      imgSrc: cat2,
      description: "Drogo ready for his closeup"
    },
    {
      id: "3",
      name: "cat3",
      imgSrc: cat3,
      description: "Mesmerized"
    },
    {
      id: "4",
      name: "cat4",
      imgSrc: cat4,
      description: "Sylvia feeling the music"
    },
    {
      id: "5",
      name: "cat5",
      imgSrc: cat5,
      description: "Stalker in the tall grass"
    },
    {
      id: "6",
      name: "cat6",
      imgSrc: cat6,
      description: "Sleeping like a human."
    }
    // ,
    // {
    //   id: "7",
    //   name: "cat7",
    //   imgSrc: cat7,
    //   description: "Sleeping like a human."
    // },
    // {
    //   id: "8",
    //   name: "cat8",
    //   imgSrc: cat8,
    //   description: "Stalker in the tall grass"
    // },
    // {
    //   id: "9",
    //   name: "cat9",
    //   imgSrc: cat9,
    //   description: "Sylvia feeling the music"
    // },
    // {
    //   id: "10",
    //   name: "cat10",
    //   imgSrc: cat10,
    //   description: "Mesmerized"
    // },
    // {
    //   id: "11",
    //   name: "cat11",
    //   imgSrc: cat11,
    //   description: "I'm ready for my closeup"
    // },
    // {
    //   id: "12",
    //   name: "cat12",
    //   imgSrc: cat12,
    //   description: "Sleeping Beauty"
    // }
  ]);

  const [galleryState, setGalleryState] = useState([false, "", ""]);

  useEffect(() => {}, []);

  let catModal;
  let domBody = document.querySelector("body");
  if (galleryState[0] == true) {
    domBody.style.overflow = "hidden";
    catModal = (
      <div className="cat-modal">
        <span onClick={() => setGalleryState([false, "", ""])}>X</span>
        <div>
          <img src={galleryState[1]} />
        </div>
        <div>
          <p>{galleryState[2]}</p>
        </div>
      </div>
    );
  } else {
    catModal = <div></div>;
    domBody.style.overflow = "auto";
  }

  return (
    <div className="personal-page">
      <h2>My Cats</h2>
      <h3>Slideshow</h3>
      <section className="cat-slider-container">
        <div className="cat-slider"></div>
      </section>
      <h3>Gallery</h3>
      <section className="cat-gallery-container">
        {cats.map((cat, index) => {
          return (
            <div
              key={index}
              className="cat-item"
              onClick={() =>
                setGalleryState([true, cat.imgSrc, cat.description])
              }
            >
              <img src={cat.imgSrc} alt={cat.name} />
              <p>{cat.description}</p>
            </div>
          );
        })}

        {catModal}
        <div className="cat-gallery-modal"></div>
      </section>
      <h3>Hobbies:</h3>
      <ul>
        <li>Hiking/Outdoors</li>
        <li> Volleyball</li>
        <li> Iceskating</li>
        <li> Skiing</li>
      </ul>
      <h3> My Rig</h3>
      <ul>
        <li>Video Card: NVIDIA GeForce GTX 1060 6GB</li>
        <li>CPU: Intel Core i7-8700K 3.7GHz</li>
        <li>Motherboard: Asus</li>
        <li>
          HDD : WD Blue 1TB 7200 RPM Class, SATA 6 Gb/s, 64 MB Cache, 3.5" (WDC
          WD10EZEX-08WN4A0)
        </li>
        <li>SDD : Intel 330 Series 180GB (SSDSC2CT180A3)</li>
        <li>RAM: 16GB 4xDDR4</li>
        <li>Power Supply : 600 watts</li>
        <li>Case : Titan Shell</li>
        <li>Monitor 1 : Philips 242G5 144hz</li>
        <li>Monitor 2 : ASUS VS247</li>
        <li>Mouse : Logitech g330 silent</li>
        <li>Keyboard : CM Storm mechanical</li>
        <li>HeadPhones : Hyper x</li>
      </ul>
      <h3> Video Games</h3>
      <p>
        Born in 1990. Started working 2 years later. Below is my PC gaming
        resume for good games that I've played on release:
      </p>
      <ul>
        <li>Wolfenstein 3D (1992)</li>
        <li>Doom (1993)</li>
        <li>Hexen (1995)</li>
        <li>Command &amp; Conquer (1995)</li>
        <li>Duke Nukem (1996)</li>
        <li>Quake (1996)</li>
        <li>Quake II (1997)</li>
        <li>Unreal (1998)</li>
        <li>Half-Life (1998)</li>
        <li>Team Fortress Classic (1999)</li>
        <li>Counter-strike (1999)</li>
        <li>Unreal Tournament (1999)</li>
        <li>Quake III: Arena (1999)</li>
      </ul>
      <ul>
        <li>Diablo II (2000)</li>
        <li>Max Payne (2001)</li>
        <li>Warcraft 3 (2002)</li>
        <li>Max Payne 2 (2003)</li>
        <li>World of Warcraft (2004)</li>
        <li>Half-Life 2 (2004)</li>
        <li>Guild Wars (2005)</li>
        <li>Call of Duty 2 (2005)</li>
        <li>The Elder Scrolls IV: Oblivion (2006)</li>
        <li>Team Fortress 2 (2007)</li>
        <li>Call of Duty 4: Modern Warfare (2007)</li>
        <li>Fallout 3 (2008)</li>
        <li>Call of Duty: Modern Warfare 2 (2009)</li>
      </ul>
      <ul>
        <li>Starcraft II (2010)</li>
        <li>Dark Souls (2011)</li>
        <li>Counter-Strike: GO (2012)</li>
        <li>Dota 2 (2013)</li>
        <li>Hearthstone (2014)</li>
        <li>The Witcher 3: The Wild Hunt (2015)</li>
        <li>Overwatch (2016)</li>
        <li>Doom (2016)</li>
        <li>Dark Souls III (2016)</li>
        <li>World of Warcraft: Classic (2019)</li>
      </ul>

      <ul>
        <li>Warcraft 3: Reforged (2020)</li>
        <li>Diablo 4 (2020)</li>
        <li>Overwatch 2 (2020)</li>
      </ul>

      <h3>Console Games: </h3>

      <h3> Movies</h3>
      <ul>
        <li>The Matrix</li>
        <li>Liar Liar</li>
        <li>True Lies</li>
        <li>X-Men</li>
        <li>The Lord of the Rings</li>
      </ul>

      <h3> Music</h3>
      <ul>
        <li>TOOL</li>
        <li>System of a Down</li>
        <li>The Contortionist</li>
        <li>Caligula's Horse</li>
        <li>Opeth</li>
        <li>Children of Bodom</li>
        <li>Pink Floyd</li>
        <li>Soen</li>
        <li>The Smashing Pumpkins</li>
        <li>Enchant</li>
        <li>Rage Against the Machine</li>
      </ul>

      <h4> Favorite Guitarists:</h4>
      <ul>
        <li>Adam Jones - TOOL</li>
        <li>Mikael kerfeldt - Opeth</li>
        <li>John Petrucci - Dream Theater</li>
        <li>Kirk Hammett - Metallica</li>
        <li>David Gilmour - Pink Floyd</li>
        <li>Alexi Laiho - Children of Bodom</li>
        <li>Billy Howerdel - A Perfect Circle</li>
        <li>James Iha - The Smashing Pumpkins/A Perfect Circle</li>
      </ul>

      <h4> Favorite Bassists:</h4>
      <ul>
        <li>Just Chancellor - TOOL</li>
        <li>Martn Mndez - Opeth</li>
        <li>John Myung - Dream Theater</li>
        <li>Tim Commerford - Rage Against the Machine/Audioslave</li>
      </ul>

      <h4> Favorite Drummers:</h4>
      <ul>
        <li>Danny Carey - TOOL</li>
        <li>Martin Axenrot - Opeth</li>
        <li>Martin Lopez - Opeth/Soen</li>
        <li>John Dolmayan - System of a Down</li>
        <li>Brad Wilk - Rage Against the Machine/Audioslave</li>
      </ul>

      <h4> Favorite Singers:</h4>
      <ul>
